import React from "react";

export default function MovieCrad(props) {
  return (
    <div>
      <div>
        <img src={props.imgURL} alt="Card-image-cap" />
        <div>
          <h5>{props.title}</h5>
          <p>{props.description}</p>
          <a href="https://www.youtube.com/" class="btn btn-primary">
            Go Youtube
          </a>
        </div>
      </div>
    </div>
  );
}
